import SocialItem from "./SocialItem";


function Social () {
    return(
        <ul className="list-group">

            p = {{
                
            }}

            <SocialItem 
            media = 'Facebook'
            id = 'Facebook'
            img='https://picsum.photos/60'/>
            

            <SocialItem 
            media = 'Instagram' 
            id = 'Instagram'
            img='https://picsum.photos/61'/>


            <SocialItem 
            media = 'Snapchat' 
            id = 'Snapchat'
            img='https://picsum.photos/62'/>


            <SocialItem 
            media = 'Youtube' 
            id = 'Youtube'
            img='https://picsum.photos/63'/>

        </ul>
    )
}

export default Social ;
